import css from './TikTokLikesPage.module.css';

export default function TikTokLikes({ info, index, key, toggleLikes }) {
  return (
    <div
      className={`${css.faq} ${faq.open ? css.open : ''}`}
      key={index}
      onClick={() => toggleLikes(index)}
    >
      <div className="buyLikesQuantity">
        <div className="count"></div>
        <div className="discount"></div>
      </div>
    </div>
  );
}
